[functions]

  [functions._ipx]
  node_bundler = "nft"

  [functions.___netlify-handler]
  included_files = [
    ".env",
    ".env.local",
    ".env.production",
    ".env.production.local",
    "./public/locales/**",
    "./next-i18next.config.js",
    ".next/server/**",
    ".next/serverless/**",
    ".next/*.json",
    ".next/BUILD_ID",
    ".next/static/chunks/webpack-middleware*.js",
    "!.next/server/**/*.js.nft.json",
    "!.next/server/**/*.map",
    "!**/node_modules/@next/swc*/**/*",
    "!../../node_modules/next/dist/compiled/@ampproject/toolbox-optimizer/**/*",
    "!../../node_modules/next/dist/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/next-server/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/compiled/webpack/bundle4.js",
    "!../../node_modules/next/dist/compiled/webpack/bundle5.js",
    "../../node_modules/styled-jsx/style.js",
    "!../../node_modules/sharp/**/*"
  ]
  external_node_modules = []
  node_bundler = "nft"

  [functions.___netlify-odb-handler]
  included_files = [
    ".env",
    ".env.local",
    ".env.production",
    ".env.production.local",
    "./public/locales/**",
    "./next-i18next.config.js",
    ".next/server/**",
    ".next/serverless/**",
    ".next/*.json",
    ".next/BUILD_ID",
    ".next/static/chunks/webpack-middleware*.js",
    "!.next/server/**/*.js.nft.json",
    "!.next/server/**/*.map",
    "!**/node_modules/@next/swc*/**/*",
    "!../../node_modules/next/dist/compiled/@ampproject/toolbox-optimizer/**/*",
    "!../../node_modules/next/dist/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/next-server/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/compiled/webpack/bundle4.js",
    "!../../node_modules/next/dist/compiled/webpack/bundle5.js",
    "../../node_modules/styled-jsx/style.js",
    "!../../node_modules/sharp/**/*"
  ]
  external_node_modules = []
  node_bundler = "nft"

  [functions."_api_*"]
  included_files = [
    ".env",
    ".env.local",
    ".env.production",
    ".env.production.local",
    "./public/locales/**",
    "./next-i18next.config.js",
    ".next/server/**",
    ".next/serverless/**",
    ".next/*.json",
    ".next/BUILD_ID",
    ".next/static/chunks/webpack-middleware*.js",
    "!.next/server/**/*.js.nft.json",
    "!.next/server/**/*.map",
    "!**/node_modules/@next/swc*/**/*",
    "!../../node_modules/next/dist/compiled/@ampproject/toolbox-optimizer/**/*",
    "!../../node_modules/next/dist/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/next-server/server/lib/squoosh/**/*.wasm",
    "!../../node_modules/next/dist/compiled/webpack/bundle4.js",
    "!../../node_modules/next/dist/compiled/webpack/bundle5.js",
    "../../node_modules/styled-jsx/style.js",
    "!../../node_modules/sharp/**/*"
  ]
  external_node_modules = []
  node_bundler = "nft"

[build]
command = "yarn run build"
ignore = "/bin/false"

  [build.environment]
  NODE_VERSION = "18.19.0"
  YARN_VERSION = "1.22.4"
  NEXT_TELEMETRY_DISABLED = "1"
  NODE_OPTIONS = "--max_old_space_size=4096"
  LISTINGS_QUERY = "/listings"
  NEXT_PRIVATE_TARGET = "server"

[[plugins]]
package = "@netlify/plugin-nextjs"

[[redirects]]
from = "/_next/static/*"
to = "/static/:splat"
status = 200

[[redirects]]
from = "/:locale/_next/static/*"
to = "/static/:splat"
status = 200

[[redirects]]
from = "/_next/image*"
to = "/_ipx/w_:width,q_:quality/:url"
status = 301

  [redirects.query]
  url = ":url"
  w = ":width"
  q = ":quality"

[[redirects]]
from = "/_ipx/*"
to = "/.netlify/builders/_ipx"
status = 200

[[redirects]]
from = "/"
to = "/.netlify/functions/___netlify-handler"
status = 200
force = true

  [redirects.conditions]
  Cookie = [
    "NEXT_LOCALE"
  ]

[[redirects]]
from = "/"
to = "/es"
status = 301
force = true

  [redirects.conditions]
  Language = [
    "es"
  ]

